    location_id INT PRIMARY KEY,
    latitude FLOAT,
    longitude FLOAT,
    signal_strength INT
);

CREATE TABLE network_coverage (
    coverage_id INT PRIMARY KEY,
    network_provider VARCHAR(50),
    coverage_range FLOAT
);

CREATE TABLE network_devices (
    device_id INT PRIMARY KEY,
    device_type VARCHAR(50),
    installation_date DATE
);

CREATE TABLE network_optimization (
    optimization_id INT PRIMARY KEY,
    optimization_type VARCHAR(50),
    completed_date DATE
);

